import React from 'react'
import '../style.css';

function Row({make_ID, make_name, make_model}) {
    return (
        <div>
            <li>
                <h3> ID: {make_ID}</h3>
                <h3> Make Name: {make_name}</h3>
                <h3> Model Name: {make_model}</h3>
            </li>
        </div>
    )
}

export default Row
